import { NavLink } from "react-router-dom";
// import { BsArrowLeft } from "react-icons/bs";
const Index = (props) => {
  return (
    <>
      <NavLink
        to={props.TitleLink ? props.TitleLink : null}
        className="profil_emp_inter_page_title finance_inter_page_title"
      >
        {props.TilelIcon}
        {props.Name}
      </NavLink>
    </>
  );
};
export default Index;
